import * as React from 'react';

import { ThemeProvider, theme } from './theme';

const DoczWrapper: React.SFC = ({ children }) => (
  <ThemeProvider theme={theme}>{children}</ThemeProvider>
);

export default DoczWrapper;
try {
    // @ts-ignore
    DoczWrapper.displayName = "DoczWrapper";
    // @ts-ignore
    DoczWrapper.__docgenInfo = { "description": "", "displayName": "DoczWrapper", "props": {} };
    // @ts-ignore
    if (typeof STORYBOOK_REACT_CLASSES !== "undefined")
        // @ts-ignore
        STORYBOOK_REACT_CLASSES["src/DoczWrapper.tsx#DoczWrapper"] = { docgenInfo: DoczWrapper.__docgenInfo, name: "DoczWrapper", path: "src/DoczWrapper.tsx#DoczWrapper" };
}
catch (__react_docgen_typescript_loader_error) { }
